import { CssBaseline } from '@mui/material';

import React from 'react';
import ReactDOM from 'react-dom/client'; 
import App from './App';
import './index.css'; 


// Create a root element for rendering the app
const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
